import { useState } from "react";
function App() {
  return <Myapp />;
}

function Myapp() {
  const date = new Date().toDateString();

  function step() {
    console.log(1 + 9);
  }
  return (
    <div>
      <button>-</button>
      <span> Step: 1 </span>
      <button onClick={step}>+</button>
      <br></br>
      <button>-</button>
      <span> Count: 0 </span>
      <button>+</button>
      <>
        <p>Today is {date}</p>
      </>
    </div>
  );
}
export default App;
